I have a list of strings, and I want to sort them in case-sensative way. For example, if I have a list of strings like this:
["a", "A", "b", "B", "c", "C"]
I want to sort them like this:
["A", "a", "B", "b", "C", "c"]
I tried to use sort() function, but it doesn't work.
var list = ["a", "A", "b", "B", "c", "C"];
list.sort();
console.log(list);
["A", "a", "B", "b", "C", "c"]
marked as duplicate by Bergi  javascript Sep 21 '16 at 15:01
You can use a custom compare function:
list.sort(function(a, b) {
    return a.toLowerCase().localeCompare(b.toLowerCase());
["A", "a", "B", "b", "C", "c"]
You can also use localeCompare() directly:
list.sort(function(a, b) {
    return a.localeCompare(b, undefined, {sensitivity: 'accent'});
["A", "a", "B", "b", "C", "c"]
The second argument to localeCompare() is the locale to use. If you don't specify one, the browser will use the user's preferred locale. The third argument is an options
